import React from 'react'
import In from './images/in.svg'

function Footer_lowest() {
  return (
    <div>
        <a>
            <img src={In} style={{width:"15px"}}/>
            <span> India</span>
        </a>

    </div>
  )
}

export default Footer_lowest
